import { login, logout} from "./login"
import { displayMap } from "./mapbox"
import { updatesetting} from "./updateSettings"
import '@babel/polyfill'
const mapBox = document.getElementById('map')
if(mapBox){
    const locations = JSON.parse(map.dataset.locations)
    displayMap(locations)
}
const formlogin = document.querySelector('.form--login')
if(formlogin){
    formlogin.addEventListener('submit', function(e){
        e.preventDefault()
        const email = document.getElementById('email').value
        const password = document.getElementById('password').value
        login(email, password)
    })
}
const btnlogout = document.querySelector('.nav__el--logout')
if(btnlogout) btnlogout.addEventListener('click', logout)
const formupdate = document.querySelector('.form-user-data')
if(formupdate) formupdate.addEventListener('submit', function(e){
    e.preventDefault()
    const name = document.getElementById('name').value
    const email = document.getElementById('email').value
    updatesetting({name, email}, 'data', 'Data updated Successfully. Please log in again with the new email')
})
const formupdatepassword = document.querySelector('.form-user-settings')
if(formupdatepassword){
    formupdatepassword.addEventListener('submit', function(e){
        e.preventDefault()
        const currentPassword = document.getElementById('password-current').value
        const password = document.getElementById('password').value
        const passwordConfirm = document.getElementById('password-confirm').value
        updatesetting({currentPassword, password, passwordConfirm}, 'password', 'Password updated Successfully. Please log in again with the new password')
    })
}
